function updateList() {
    var metrics = this.getMetrics();

    metrics.sort(function(a, b) {
        if (b.methods !== a.methods) return b.methods - a.methods;
        return b.subclasses - a.subclasses;
    });

    var $ = jQuery;
    var table = $('<table>');
    $('<tr>')
        .append($('<th>').text('Class name'))
        .append($('<th>').text('WMC'))
        .append($('<th>').text('NOC'))
        .append($('<th>').text('DIT'))
        .appendTo(table);

    metrics.forEach(function(metrics) {
        $('<tr>')
            .append($('<td>').text(metrics.name))
            .append($('<td>').text(metrics.methods))
            .append($('<td>').text(metrics.subclasses))
            .append($('<td>').text(metrics.depthInTree))
            .appendTo(table);
    });

    var container = $('<div>')
        .css({ overflow: 'auto', width: '100%', height:'100%' })
        .append(table);
    $(this.renderContext().shapeNode).empty().append(container);

}

