function getMetrics() {
	return this.classes.map(function(cls) {
        return {
            name: cls.displayName || cls.type || cls.name,
            methods: Functions.own(cls.prototype).length +
            		 Functions.own(cls).length,
            subclasses: cls.directSubclasses().length,
            depthInTree: cls.superclasses().length
        };
    });
}

