function updateModuleList() {
    for (var i = 0; i < this.owner.submorphs.length; i++) {
        if (this.owner.submorphs[i].name === 'TextInput') {
            try {
                var ns = eval(this.owner.submorphs[i].input.getTextString());
                this.fillClassCache(ns);
                this.updateList();
            } catch(err) {
                alert(err);
            }
            break;
        }
    }
}

